  const list = results && results.map(villager => 
    <li key={villager.id}>
      <Link to={`/villagers/${villager.id}`}            className="link"> 
        {villager.name}
      </Link> 
      <button 
        onClick={() => {
          return handleAdd(villager.id, island.id);}}> 
        <img src={add} alt="add villager to island" />
      </button>
    </li>)

    console.log(island)
  return (
    <>
      {list}
